a:260:{i:0;a:1:{s:2:"id";s:19:"2391156917981748597";}i:1;a:1:{s:10:"short_code";s:11:"CEvGIxKhR11";}i:2;a:1:{s:12:"created_time";i:1599268139;}i:3;a:1:{s:7:"caption";s:1521:""GAISUWA" in English means greetings. This was inscribed by an unknown fellow at a strategic location as a freehand work of art not only to convey the mere meaning to the audience but to inform visitors they are welcome, tourists they are safe, strangers they are covered and migrants they are accommodated. These unique message portrayed exactly why Kano is nicknamed "tumbin giwa" meaning the stomach of elephant but connotes a spacious location where everyone can thrive. No wonder Kano has almost every tribe of the world residing in it. 
Right from the first settler, a millennium ago, Kano city has grow over years as a cosmopolitan center with the convergence of diverse ethnic communities from most part of Nigeria and Africa mixing and mingling with the original Hausa founders melting into a social unique entity called "Kanawa" meaning an indigene of Kano. Most of the Kanawas are settlers from places across Nigerian state and the rest of the world. Here everyone is indigene and all it takes to be an indigene since the 15th century till present time is one's loyalty to the Emir's throne, Emirate and desire to reside here.

